widgets_values:
* {
    font-family: arial;
}
img{ 

    transform: scale(0.7) translate(16px,0px);;

}
.startPage {
    position: absolute;
    width: 240px; /* 360px / 1.5 */
    height: 250px; /* 375px / 1.5 */
    z-index: 0;
    transition: transform 0.3s ease;
}
.startPage:hover {
    transform: translateY(-1%);
}
.classnew {
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    margin-top: 16px; /* 24px / 1.5 */
    margin-bottom: 16px; /* 24px / 1.5 */
}

.hoverContainer :last-child {
    margin-bottom: 0px;
}

.hoverContainer {
    background: black;
    border-radius: 18px; /* 24px / 1.5 */
    padding: 12px; /* 18px / 1.5 */
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    justify-content: flex-start;
    align-self: stretch;
    flex-shrink: 0;
    height: fit-content;
    max-width: 224px; /* 336px / 1.5 */
    position: relative;
    margin-bottom: 8px; /* 12px / 1.5 */
    left: 50%;
    height: min-content;
    top: 50%;
    transform: translate(-50%, -50%);
}

.header_discrip {
    font-size: 14px; /* 21px / 1.5 */
    font-weight: 200;
    color: #6f6f6f;
    width: fit-content;
}

.h1 {
    font-size: 25px; /* 38px / 1.5 */
    margin: 8px 0px; /* 12px 0px / 1.5 */
    font-weight: 700;
    text-align: center;
}

.size-smallButton {
    font-size: 14px; /* 21px / 1.5 */
    border-radius: 8px; /* 12px / 1.5 */
    height: 32px; /* 48px / 1.5 */
    min-width: 32px; /* 48px / 1.5 */
    display: flex;
    align-items: center;
    width: 93%; /* 93% / 1.5 */
    margin-top: 8px; /* 12px / 1.5 */
    justify-content: center;
    cursor: pointer;
}

.style-input {
    background: #2a2a2b;
    border-radius: 8px; /* 12px / 1.5 */
    padding: 8px; /* 12px / 1.5 */
}

.style-input:hover {
    background: #3b3b3c;
}

.header {
    padding-bottom: 8px; /* 12px / 1.5 */
    margin-bottom: 8px; /* 12px / 1.5 */
    border-bottom: 1px solid #3e3e3e;
    width: 100%;
    height: 24px; /* 36px / 1.5 */
    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-direction: row;
}

a {
    width: 100%;
    color: #B6B6B7;
}

a:hover,
a:hover .header_discrip {
    color: #DDDDDD !important;
}
